CREATE FUNCTION public.grant_super_admin_access() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    super_admin_roles RECORD;
BEGIN
    -- Loop through all Super Admin roles
    FOR super_admin_roles IN 
        SELECT role_id FROM role_master WHERE role_name = 'Super Admin'
    LOOP
        -- Grant full access to the new module
            role_id,
            module_id,
            can_view,
            can_add,
            can_edit,
            can_delete,
            can_export,
            created_at,
            updated_at
        ) VALUES (
            super_admin_roles.role_id,
            NEW.module_id,
            TRUE,  -- can_view
            TRUE,  -- can_add
            TRUE,  -- can_edit
            TRUE,  -- can_delete
            TRUE,  -- can_export
            NOW(), -- created_at
            NOW()  -- updated_at
        );
    END LOOP;
    
    RETURN NEW;
END;
$$;


