    LANGUAGE plpgsql
    AS $_$
BEGIN
    -- Only hash if password is provided in plain text
    IF NEW.password_hash IS NOT NULL AND 
       (TG_OP = 'INSERT' OR NEW.password_hash <> OLD.password_hash) AND
       NOT NEW.password_hash LIKE '$2b$%' THEN  -- Not already a bcrypt hash
        
