--
-- TOC entry 324 (class 1255 OID 199493)
-- Name: validate_user_role_hospital(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.validate_user_role_hospital() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Get user's hospital_id and validate role belongs to same hospital
    IF NOT EXISTS (
        SELECT 1 
        FROM users u 
        JOIN role_master rm ON rm.role_id = NEW.role_id
        WHERE u.user_id = NEW.user_id 
        AND u.hospital_id = rm.hospital_id
    ) THEN
        RAISE EXCEPTION 'Security Violation: Cannot assign role from different hospital';
    END IF;
    
    RETURN NEW;
END;
$$;


