-- Name: payment_document_summary; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.payment_document_summary AS
 SELECT p.payment_id,
    p.hospital_id,
    p.branch_id,
    count(d.document_id) AS total_documents,
    count(
        CASE
            WHEN ((d.verification_status)::text = 'verified'::text) THEN 1
            ELSE NULL::integer
        END) AS verified_documents,
    count(
        CASE
            WHEN ((d.verification_status)::text = 'pending'::text) THEN 1
            ELSE NULL::integer
        END) AS pending_documents,
    count(
        CASE
            WHEN (d.required_for_approval = true) THEN 1
            ELSE NULL::integer
        END) AS required_documents,
    max(d.created_at) AS latest_document_date
   FROM (public.supplier_payment p
     LEFT JOIN public.payment_documents d ON (((p.payment_id = d.payment_id) AND (d.deleted_flag = false))))
  GROUP BY p.payment_id, p.hospital_id, p.branch_id;


