--
-- TOC entry 275 (class 1259 OID 199851)
-- Name: supplier_invoices_view; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.supplier_invoices_view AS
 SELECT si.invoice_id,
    si.hospital_id,
    si.branch_id,
    si.supplier_invoice_number,
    si.invoice_date,
    si.due_date,
    EXTRACT(year FROM si.invoice_date) AS invoice_year,
    EXTRACT(month FROM si.invoice_date) AS invoice_month,
    to_char(si.invoice_date, 'YYYY-MM'::text) AS invoice_month_year,
    to_char(si.invoice_date, 'Q'::text) AS invoice_quarter,
    si.po_id,
    po.po_number,
    po.po_date,
    po.quotation_id,
    si.supplier_id,
    COALESCE(s.supplier_name, 'Unknown Supplier'::character varying) AS supplier_name,
    s.supplier_category,
    s.contact_person_name AS supplier_contact_person,
    (s.contact_info ->> 'mobile'::text) AS supplier_mobile,
    (s.contact_info ->> 'phone'::text) AS supplier_phone,
    s.email AS supplier_email,
    s.gst_registration_number AS supplier_gst,
    s.payment_terms AS supplier_payment_terms,
    s.status AS supplier_status,
    b.name AS branch_name,
    b.state_code AS branch_state_code,
    b.is_active AS branch_is_active,
    h.name AS hospital_name,
    h.license_no AS hospital_license_no,
    si.total_amount AS invoice_total_amount,
    si.cgst_amount,
    si.sgst_amount,
    si.igst_amount,
    si.total_gst_amount,
    (COALESCE(( SELECT sum(sp.amount) AS sum
           FROM public.supplier_payment sp
          WHERE ((sp.invoice_id = si.invoice_id) AND ((sp.workflow_status)::text = ANY (ARRAY[('approved'::character varying)::text, ('completed'::character varying)::text, ('paid'::character varying)::text])))), (0)::numeric))::numeric(12,2) AS paid_amount,
    ((si.total_amount - COALESCE(( SELECT sum(sp.amount) AS sum
           FROM public.supplier_payment sp
          WHERE ((sp.invoice_id = si.invoice_id) AND ((sp.workflow_status)::text = ANY (ARRAY[('approved'::character varying)::text, ('completed'::character varying)::text, ('paid'::character varying)::text])))), (0)::numeric)))::numeric(12,2) AS balance_amount,
    si.supplier_gstin,
    si.place_of_supply,
    si.reverse_charge,
    si.itc_eligible,
    si.currency_code,
    si.exchange_rate,
    si.payment_status,
    si.gl_posted,
    si.inventory_posted,
    si.posting_date,
    si.posting_reference,
    si.is_reversed,
    si.is_credit_note,
    si.original_invoice_id,
    si.reversed_by_invoice_id,
    si.reversal_reason,
    si.notes,
        CASE
            WHEN (si.invoice_date IS NOT NULL) THEN (CURRENT_DATE - (si.invoice_date)::date)
            ELSE NULL::integer
        END AS invoice_age_days,
        CASE
            WHEN (si.due_date IS NOT NULL) THEN (CURRENT_DATE - si.due_date)
            ELSE NULL::integer
        END AS days_overdue,
        CASE
            WHEN ((si.payment_status)::text = 'paid'::text) THEN 'Paid'::text
            WHEN (si.due_date IS NULL) THEN 'No Due Date'::text
            WHEN (si.due_date < CURRENT_DATE) THEN 'Overdue'::text
            WHEN (si.due_date = CURRENT_DATE) THEN 'Due Today'::text
            WHEN (si.due_date <= (CURRENT_DATE + '7 days'::interval)) THEN 'Due Soon'::text
            ELSE 'Current'::text
        END AS aging_status,
        CASE
            WHEN ((si.payment_status)::text = 'paid'::text) THEN 'Paid'::text
            WHEN (si.due_date IS NULL) THEN 'No Due Date'::text
            WHEN (CURRENT_DATE <= si.due_date) THEN 'Current'::text
            WHEN ((CURRENT_DATE - si.due_date) <= 30) THEN '1-30 Days'::text
            WHEN ((CURRENT_DATE - si.due_date) <= 60) THEN '31-60 Days'::text
            WHEN ((CURRENT_DATE - si.due_date) <= 90) THEN '61-90 Days'::text
            ELSE 'Over 90 Days'::text
        END AS aging_bucket,
    si.created_at,
    si.created_by,
    si.updated_at,
    si.updated_by,
    si.is_deleted,
    si.deleted_at,
    si.deleted_by,
    lower((((((COALESCE(si.supplier_invoice_number, ''::character varying))::text || ' '::text) || (COALESCE(s.supplier_name, ''::character varying))::text) || ' '::text) || (COALESCE(po.po_number, ''::character varying))::text)) AS search_text
   FROM ((((public.supplier_invoice si
     LEFT JOIN public.suppliers s ON ((si.supplier_id = s.supplier_id)))
     LEFT JOIN public.purchase_order_header po ON ((si.po_id = po.po_id)))
     LEFT JOIN public.branches b ON ((si.branch_id = b.branch_id)))
     LEFT JOIN public.hospitals h ON ((si.hospital_id = h.hospital_id)));


ALTER VIEW public.supplier_invoices_view OWNER TO postgres;

--
-- TOC entry 276 (class 1259 OID 199856)
-- Name: supplier_payments_view; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.supplier_payments_view AS
 SELECT sp.payment_id,
    sp.hospital_id,
    sp.branch_id,
    sp.reference_no,
    sp.payment_date,
    EXTRACT(year FROM sp.payment_date) AS payment_year,
    EXTRACT(month FROM sp.payment_date) AS payment_month,
    to_char(sp.payment_date, 'YYYY-MM'::text) AS payment_month_year,
    to_char(sp.payment_date, 'Q'::text) AS payment_quarter,
    to_char(sp.payment_date, 'Day'::text) AS payment_day_name,
    sp.invoice_id,
    si.supplier_invoice_number,
    si.invoice_date,
    si.total_amount AS invoice_amount,
    si.po_id,
    po.po_number,
    sp.supplier_id,
    COALESCE(s.supplier_name, 'Unknown Supplier'::character varying) AS supplier_name,
    s.supplier_category,
    s.contact_person_name AS supplier_contact_person,
    (s.contact_info ->> 'mobile'::text) AS supplier_mobile,
    (s.contact_info ->> 'phone'::text) AS supplier_phone,
    s.email AS supplier_email,
    s.gst_registration_number AS supplier_gst,
    s.payment_terms AS supplier_payment_terms,
    (s.bank_details ->> 'bank_name'::text) AS supplier_bank_name,
    (s.bank_details ->> 'account_number'::text) AS supplier_account_number,
    (s.bank_details ->> 'ifsc_code'::text) AS supplier_ifsc_code,
    s.status AS supplier_status,
    b.name AS branch_name,
    b.state_code AS branch_state_code,
    b.is_active AS branch_is_active,
    h.name AS hospital_name,
    h.license_no AS hospital_license_no,
    sp.amount AS payment_amount,
    sp.payment_method,
    sp.payment_category,
    sp.payment_source,
    sp.status AS payment_status_old,
    COALESCE(sp.cash_amount, (0)::numeric) AS cash_amount,
    COALESCE(sp.cheque_amount, (0)::numeric) AS cheque_amount,
    COALESCE(sp.bank_transfer_amount, (0)::numeric) AS bank_transfer_amount,
    COALESCE(sp.upi_amount, (0)::numeric) AS upi_amount,
    COALESCE(sp.advance_amount, (0)::numeric) AS advance_amount,
    sp.cheque_number,
    sp.cheque_date,
    sp.cheque_bank,
    sp.cheque_status,
    sp.cheque_clearance_date,
    sp.bank_name AS payment_bank_name,
    sp.bank_reference_number,
    sp.ifsc_code AS payment_ifsc_code,
    sp.transfer_mode,
    sp.upi_transaction_id,
    sp.upi_reference_id,
    sp.upi_id,
    sp.upi_app_name,
    sp.notes,
    sp.currency_code,
    sp.exchange_rate,
    sp.workflow_status,
    sp.workflow_status AS payment_status,
    sp.approved_by,
    sp.approved_at,
    sp.approved_at AS approval_date,
    sp.rejected_by,
    sp.rejected_at,
    sp.rejection_reason,
    sp.requires_approval,
    sp.approval_level,
        CASE
            WHEN ((sp.payment_method)::text = ANY (ARRAY[('cash'::character varying)::text, ('Cash'::character varying)::text])) THEN 'Cash'::text
            WHEN ((sp.payment_method)::text = ANY (ARRAY[('cheque'::character varying)::text, ('Cheque'::character varying)::text, ('check'::character varying)::text])) THEN 'Cheque'::text
            WHEN ((sp.payment_method)::text = ANY (ARRAY[('bank_transfer'::character varying)::text, ('NEFT'::character varying)::text, ('RTGS'::character varying)::text, ('IMPS'::character varying)::text])) THEN 'Electronic'::text
            WHEN ((sp.payment_method)::text = ANY (ARRAY[('UPI'::character varying)::text, ('upi'::character varying)::text])) THEN 'UPI'::text
            WHEN ((sp.payment_method)::text = ANY (ARRAY[('credit_card'::character varying)::text, ('debit_card'::character varying)::text, ('card'::character varying)::text])) THEN 'Card'::text
            WHEN ((sp.payment_method)::text = 'advance'::text) THEN 'Advance'::text
            ELSE 'Other'::text
        END AS payment_method_group,
    sp.reconciliation_status,
    sp.reconciliation_date,
    sp.gl_posted,
    sp.posting_date,
    sp.posting_reference,
        CASE
            WHEN ((sp.payment_date IS NOT NULL) AND (si.invoice_date IS NOT NULL)) THEN ((sp.payment_date)::date - (si.invoice_date)::date)
            ELSE NULL::integer
        END AS days_to_payment,
        CASE
            WHEN ((sp.payment_date IS NOT NULL) AND (si.due_date IS NOT NULL)) THEN ((sp.payment_date)::date - si.due_date)
            ELSE NULL::integer
        END AS days_from_due_date,
        CASE
            WHEN (si.due_date IS NULL) THEN 'Unknown'::text
            WHEN (sp.payment_date IS NULL) THEN 'Not Paid'::text
            WHEN ((sp.payment_date)::date <= si.due_date) THEN 'On Time'::text
            ELSE 'Late'::text
        END AS payment_timeliness,
    sp.created_at,
    sp.created_by,
    sp.updated_at,
    sp.updated_by,
    sp.is_deleted,
    sp.deleted_at,
    sp.deleted_by,
    lower((((((((((((((COALESCE(sp.reference_no, ''::character varying))::text || ' '::text) || (COALESCE(s.supplier_name, ''::character varying))::text) || ' '::text) || (COALESCE(si.supplier_invoice_number, ''::character varying))::text) || ' '::text) || (COALESCE(po.po_number, ''::character varying))::text) || ' '::text) || (COALESCE(sp.cheque_number, ''::character varying))::text) || ' '::text) || (COALESCE(sp.bank_reference_number, ''::character varying))::text) || ' '::text) || (COALESCE(sp.upi_transaction_id, ''::character varying))::text)) AS search_text
   FROM (((((public.supplier_payment sp
     LEFT JOIN public.suppliers s ON ((sp.supplier_id = s.supplier_id)))
     LEFT JOIN public.supplier_invoice si ON ((sp.invoice_id = si.invoice_id)))
     LEFT JOIN public.purchase_order_header po ON ((si.po_id = po.po_id)))
     LEFT JOIN public.branches b ON ((sp.branch_id = b.branch_id)))
     LEFT JOIN public.hospitals h ON ((sp.hospital_id = h.hospital_id)));


