--
-- TOC entry 281 (class 1259 OID 199880)
-- Name: v_supplier_advance_balance; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_supplier_advance_balance AS
 WITH advance_subledger AS (
         SELECT supplier_advance_adjustments.supplier_id,
            supplier_advance_adjustments.hospital_id,
            supplier_advance_adjustments.branch_id,
            supplier_advance_adjustments.source_payment_id AS payment_id,
            sum(
                CASE
                    WHEN ((supplier_advance_adjustments.adjustment_type)::text = 'advance_receipt'::text) THEN supplier_advance_adjustments.amount
                    ELSE (0)::numeric
                END) AS debit_total,
            sum(
                CASE
                    WHEN ((supplier_advance_adjustments.adjustment_type)::text = 'allocation'::text) THEN supplier_advance_adjustments.amount
                    ELSE (0)::numeric
                END) AS credit_total,
            min(supplier_advance_adjustments.adjustment_date) AS first_transaction_date,
            max(supplier_advance_adjustments.adjustment_date) AS last_transaction_date,
            count(*) AS transaction_count
           FROM public.supplier_advance_adjustments
          GROUP BY supplier_advance_adjustments.supplier_id, supplier_advance_adjustments.hospital_id, supplier_advance_adjustments.branch_id, supplier_advance_adjustments.source_payment_id
        )
 SELECT sp.supplier_id,
    sp.hospital_id,
    sp.branch_id,
    sp.payment_id AS advance_payment_id,
    sp.payment_date AS advance_date,
    sp.amount AS original_advance_amount,
    sp.reference_no,
    COALESCE(asl.credit_total, (0)::numeric) AS allocated_amount,
    (COALESCE(asl.debit_total, (0)::numeric) - COALESCE(asl.credit_total, (0)::numeric)) AS remaining_balance,
    COALESCE((asl.transaction_count - 1), (0)::bigint) AS allocation_count
   FROM (public.supplier_payment sp
     LEFT JOIN advance_subledger asl ON ((sp.payment_id = asl.payment_id)))
  WHERE ((sp.invoice_id IS NULL) AND ((sp.workflow_status)::text = 'approved'::text) AND (sp.is_deleted = false) AND ((COALESCE(asl.debit_total, (0)::numeric) - COALESCE(asl.credit_total, (0)::numeric)) > 0.01))
  ORDER BY sp.payment_date;


ALTER VIEW public.v_supplier_advance_balance OWNER TO postgres;

