COMMENT ON VIEW public.v_supplier_advance_balance IS 'Double-entry view: Balance = Debits (advance_receipt) - Credits (allocation)';


--
-- TOC entry 282 (class 1259 OID 199885)
-- Name: v_supplier_advance_transactions; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_supplier_advance_transactions AS
 SELECT saa.adjustment_id,
    saa.supplier_id,
    s.supplier_name,
    saa.hospital_id,
    saa.branch_id,
    saa.adjustment_date,
    saa.adjustment_type,
    saa.source_payment_id,
    sp_source.reference_no AS source_reference,
    sp_source.payment_date AS source_payment_date,
    saa.target_payment_id,
    sp_target.reference_no AS target_reference,
    sp_target.payment_date AS target_payment_date,
    saa.invoice_id,
    si.supplier_invoice_number,
        CASE
            WHEN ((saa.adjustment_type)::text = 'advance_receipt'::text) THEN saa.amount
            ELSE (0)::numeric
        END AS debit_amount,
        CASE
            WHEN ((saa.adjustment_type)::text = ANY (ARRAY[('allocation'::character varying)::text, ('refund'::character varying)::text])) THEN saa.amount
            ELSE (0)::numeric
        END AS credit_amount,
    saa.amount,
    saa.notes,
    saa.created_by,
    saa.created_at
   FROM ((((public.supplier_advance_adjustments saa
     LEFT JOIN public.suppliers s ON ((saa.supplier_id = s.supplier_id)))
     LEFT JOIN public.supplier_payment sp_source ON ((saa.source_payment_id = sp_source.payment_id)))
     LEFT JOIN public.supplier_payment sp_target ON ((saa.target_payment_id = sp_target.payment_id)))
     LEFT JOIN public.supplier_invoice si ON ((saa.invoice_id = si.invoice_id)))
  ORDER BY saa.adjustment_date DESC, saa.created_at DESC;


ALTER VIEW public.v_supplier_advance_transactions OWNER TO postgres;

