CREATE VIEW public.v_unposted_invoices AS
 SELECT i.invoice_id,
    i.hospital_id,
    i.supplier_invoice_number,
    i.invoice_date,
    i.total_amount,
    i.payment_status,
    i.gl_posted,
    i.inventory_posted,
    i.posting_errors,
    s.supplier_name
   FROM (public.supplier_invoice i
     JOIN public.suppliers s ON ((i.supplier_id = s.supplier_id)))
  WHERE ((i.gl_posted = false) OR (i.inventory_posted = false));


