--
-- TOC entry 284 (class 1259 OID 199895)
-- Name: v_unposted_payments; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_unposted_payments AS
 SELECT p.payment_id,
    p.hospital_id,
    p.invoice_id,
    p.amount,
    p.payment_method,
    p.workflow_status,
    p.gl_posted,
    p.posting_errors,
    i.supplier_invoice_number,
    s.supplier_name
   FROM ((public.supplier_payment p
     JOIN public.supplier_invoice i ON ((p.invoice_id = i.invoice_id)))
     JOIN public.suppliers s ON ((i.supplier_id = s.supplier_id)))
  WHERE ((p.gl_posted = false) AND ((p.workflow_status)::text = 'approved'::text));


